// Add your API key and Search Engine ID here
const API_KEY = 'YOUR_API_KEY';
const SEARCH_ENGINE_ID = 'YOUR_SEARCH_ENGINE_ID';

function onOpen() {
  const ui = SpreadsheetApp.getUi();
  ui.createMenu('Recipe Tools')
      .addItem('Search for Recipes', 'searchRecipes')
      .addToUi();
}

function searchRecipes() {
  const ui = SpreadsheetApp.getUi();
  const response = ui.prompt('Recipe Search', 'Enter a recipe or ingredient to search for:', ui.ButtonSet.OK_CANCEL);

  if (response.getSelectedButton() == ui.Button.CANCEL) {
    return;
  }

  const searchTerm = response.getResponseText();
  const results = performSearch(searchTerm);

  if (results && results.length > 0) {
    addRecipesToSheet(results);
    ui.alert('Success', `Added ${results.length} recipes to your sheet.`, ui.ButtonSet.OK);
  } else {
    ui.alert('No Results', 'No recipes found for that search term.', ui.ButtonSet.OK);
  }
}

function performSearch(searchTerm) {
  const url = `https://www.googleapis.com/customsearch/v1?key=${API_KEY}&cx=${SEARCH_ENGINE_ID}&q=${encodeURIComponent(searchTerm + " recipe")}&num=5`;

  try {
    const response = UrlFetchApp.fetch(url);
    const data = JSON.parse(response.getContentText());

    if (data.items && data.items.length > 0) {
      return data.items.map(item => ({
        title: item.title,
        link: item.link,
        snippet: item.snippet,
        source: item.displayLink
      }));
    }
  } catch (error) {
    Logger.log('Error performing search: ' + error);
  }

  return [];
}

function addRecipesToSheet(recipes) {
  const sheet = SpreadsheetApp.getActiveSpreadsheet().getActiveSheet();
  const lastRow = Math.max(sheet.getLastRow(), 1);

  recipes.forEach((recipe, index) => {
    const row = lastRow + 1 + index;

    // Add basic recipe information
